import ToDoCard from './ToDoCard';

const CardsContainer = ({ title, toDo }) => {
  return (
    <>
      <div className="container">
        <h2>
          {title}
        </h2>
        <div className="grid-container">
          <ToDoCard title={toDo.title} description={toDo.description} done={toDo.done} />
          <ToDoCard title={toDo.title} description={toDo.description} done={toDo.done} />
          <ToDoCard title={toDo.title} description={toDo.description} done={toDo.done} />
          <ToDoCard title={toDo.title} description={toDo.description} done={toDo.done} />
        </div>
      </div>
      <style jsx>
        {`
          .container {
            margin: 10px 50px 0 50px;
          }
          .grid-container {
            display: grid;
            grid-template-columns: 1fr;
            gap: 15px;
          }
          h2 {
            color: #64D7EB;
            margin-bottom: 10px;
          }

          @media screen and (min-width: 563px) {
            .grid-container {
            display: grid;
            grid-template-columns: 1fr 1fr 1fr;

          }
          }
        `}
      </style>
    </>
  );
};

export default CardsContainer;
